import React, { useContext, useEffect, useState } from "react";
import AppWrapper from "../AppWrapper/AppWrapper";
import WalletContextProvider from "../WalletContext";
import Wallet from "./Wallet";
import SetWallet from "./SetWallet";
import { getLocal } from "../../Utils/utils";

const LandingPage = () => {
  // const walletId = useContext(WalletContextProvider);
  // console.log(walletId);
  const [walletId, setWalletId] = useState("123");
  useEffect(() => {
		const walletId = getLocal("walletId");
		if (walletId) {
			setWalletId("456");
		}
	}, [walletId])
  return (
      <AppWrapper walletId={walletId}>
        {walletId ? <Wallet /> : <SetWallet />}
      </AppWrapper>
  );
}

export default LandingPage;
